import React, { useState } from 'react';
import { AgChartsReact } from 'ag-charts-react';

// Chart Component
const Visibility = ({data}) => {
  const data_parse = data.list.splice(0,8)
  const [chartOptions, setChartOptions] = useState({
    // Data: Data to be displayed in the chart
    timeVis: [
        { time: new Date(data_parse[0].dt.slice(11,13) * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[1].dt.slice(11,13) * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[2].dt.slice(11,13) * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[3].dt.slice(11,13) * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[4].dt.slice(11,13) * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[5].dt.slice(11,13) * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[6].dt.slice(11,13) * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[7].dt.slice(11,13) * 1000).getHours(), visibility: data_parse[0].visibility},
        { time: new Date(data_parse[8].dt.slice(11,13) * 1000).getHours(), visibility: data_parse[0].visibility},
    ],
    // Series: Defines which chart type and data to use
    series: [{ type: 'line', xKey: 'time', yKey: 'visibility (km)' }],
  });
  return (
    // AgCharsReact component with options passed as prop
    <AgChartsReact options={chartOptions}/>
  );
}

export default Visibility;
